Berikut adalah contoh kode C++ untuk membuat game 2D sederhana menggunakan bibliotek SDL (Simple DirectMedia Layer):

**Game Header File (game.h)**
```cpp
#ifndef GAME_H
#define GAME_H

#include <SDL2/SDL.h>
#include <vector>

class Game {
public:
    Game(int width, int height);
    ~Game();

    void init();
    void handleEvents();
    void update();
    void render();
    void quit();

private:
    int width_;
    int height_;
    SDL_Window* window_;
    SDL_Renderer* renderer_;
    std::vector<SDL_Rect> rectangles_;
};

#endif // GAME_H
```
**Game Source File (game.cpp)**
```cpp
